import EquipmentList from "../pages/equipment-list";
import EquipmentDetail from "../pages/equipment-detail";
import EquipmentCreation from "../pages/equipment-creation";

const routers = [
    {
        path:'/',
        component:EquipmentList,
        children:[
            {
                path:'/demo1',
                component:Demo1
            },
            {
                path:'/demo2',
                component:Demo2
            },
            {
                path:'/demo3',
                component:Demo3
            }
        ]
    },
    {
        path:'/create',
        component:EquipmentCreation
    }
]
export default routers
